export const KeyboardArrowLeftFontIcon = forwardRef<HTMLElement, FontIconProps>(
  function KeyboardArrowLeftFontIcon(props, ref) {
    return (
      <FontIcon {...props} ref={ref}>
        keyboard_arrow_left
